import artbashThumb from '../../assets/artbash/poster-1main.png';
import './work.scss';

const Work = () => {
    const selectWorks = useSelector((state) => Object.keys(state.work.work));
    const data = useSelector((state) => state.work.work);


    return (
        <div className='work'>
            <Link to='/' className="thumb">
                <div className="">
                    <h2>ArtBash 2023</h2>
                    <p>2022</p>
                </div>
                <ul className='taglist'>
                    <li>identity</li>
                    <li>poster</li>
                </ul>
                <img src={artbashThumb} />
            </Link>
            {selectWorks.map((work) => <Thumbnail title={work} />)}
        </div>
    );
};

export default Work;
